pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


contract IAmRussiaHacker is ERC721 {

    uint256 MAX_ID = 238;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    constructor() ERC721("I Am Russia Hacker", "Only Code Matters") {
        }

    function claimNFT() external {
        require(balanceOf(msg.sender) == 0, "Max 1 NFT/wallet");
        require(_tokenIds.current()+1 < MAX_ID, "Not enought NFT left to mint");
        _tokenIds.increment();
        _mint(msg.sender, _tokenIds.current());
    }

    function tokenURI(uint256 token_id) public view override returns (string memory) {
        return "https://ipfs.io/ipfs/QmYTfg6Ep6VE4ujCpxbQwsAhEmnPZd7LWM7wCgRF2FtZ3q";
    }

    function totalSupply() external view returns (uint256) {
      return MAX_ID;
    }


}
